import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import DashboardLayoutBasic from "./components/AdminDashboard/AdminDashboard"; // Ensure this path is correct
import InterviewPage from "./components/UserDashboard/Interviewpage"; // Ensure this path is correct
import CandidateDashboard from "./components/UserDashboard/CandidateDashboard";
import MySimulations from './components/UserDashboard/MySimulations';



function App(){
  return (
    <Router>
      <Routes>
        <Route path="/Interviewpage" element={<InterviewPage />} />
        <Route path="/admin-dashboard" element={<DashboardLayoutBasic />} />
        <Route path="/CandidateDashboard" element={<CandidateDashboard />} />
        <Route path="/MySimulations" element={<MySimulations />} />
      </Routes>
    </Router>
  );
}

export default App;
